import React from "react";
import "./App.css";
import Books from "./pages/Books"
import logo from "./"

function App() {
  // render() {
    return (
      <div className="App">
        <div className="App-header">
          <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.netclipart.com%2Fisee%2FTJhmoo_open-book-cartoon-cartoon-open-book-clipart%2F&psig=AOvVaw3Eq8mUoHKn3itMgO6SIjgQ&ust=1589307937693000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKCq_NC3rOkCFQAAAAAdAAAAABAD" className="App-logo" alt="logo" />
          <h2>GoogleBooks</h2>
        </div>
        <Books/>
      </div>
    );
  // }
}

export default App;
